values:
"<u>Nothing</u> <u>But</u> <u>The</u> <u>Cold</u>"
<b>-Joe Clark</b>

<font color="#800000">So lonely and cold tonight;
Is there someone that can be my guiding light;
Through the thickets and poring rain;
Someone to ease this wintry pain;
She shall take my hand and lead me not astray;
I pray and ask God, when is that day?
For there is no sunlight in my life;
But there's so much pain, so much strife;
When my life becomes so cold;
You will live yours, so go on and go;
You wont know Im gone, passed away;
Until the very next day;
So live your life ever so full;
And leave me alone with nothing but the cold.</font>
